_t1_check_results:
	ldx	[%l3 + 0x38], %l5	!# Needed _t1_for Copy
	add	%l5, %i5, %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_results
